import React from 'react';
import Moment from 'moment-js'
const AllOrderItems = ({order}) => {
    return ( 
        <div class="card-deck">
  <div class="card">
    
    <div class="card-body">
      <h5 class="card-title">{order._id}</h5>
      <h5 class="card-title">{order.user}</h5>
      {order.isPaid ? (
         <h5 class="card-title">Delivered:<i class="fa fa-check-double"></i></h5>
      ):(
        <h5 class="card-title">Delivered:Not Delivered</h5>  
      )}
      {order.isDelivered ? (
         <h5 class="card-title">Delivered:<i class="fa fa-check-double"></i></h5>
      ):(
        <h5 class="card-title">Delivered:Not Delivered</h5>  
      )}
     
      <p class="card-text"><small class="text-muted">Last updated 3 mins ago</small></p>
    </div>
  </div>
  
</div>
     );
}
 
export default AllOrderItems;
